import { Accordion, Container } from "react-bootstrap"

function Question(){

    const ArraysOfQuestion = [{

    }]
    const ArraysOfQuestionOnMap = ArraysOfQuestion.map((ArrayOfQuestion) =>
    <Accordion key = {ArrayOfQuestion.id}>
        <Accordion.Item>
            <Accordion.Header>{ArrayOfQuestion.question}</Accordion.Header>
                    
            <Accordion.Body>
                {ArrayOfQuestion.answer}
            </Accordion.Body>
        </Accordion.Item>
    </Accordion>
    )

    return(
        <Container>
            {ArraysOfQuestionOnMap}
        </Container>
    )
}

export default Question
